# https://www.hackerrank.com/challenges/common-child/problem

from typing import List


# no cache (memo) - O(2^n)
def max_common_string_child_length(s1: str, s2: str) -> int:
    if not s1 or not s2:
        return 0
    if s1[0] == s2[0]:
        return 1 + max_common_string_child_length(s1[1:], s2[1:])
    return max(max_common_string_child_length(s1, s2[1:]), max_common_string_child_length(s1[1:], s2))


class MemoMaxCommonStringChild:
    __s1: str
    __s2: str
    __memo: List[int]

    def __call__(self, s1: str, s2: str) -> int:
        self.__s1 = s1
        self.__s2 = s2
        if not s1 or not s2:
            return 0
        self.__memo = [-1 for _ in range(len(s1) * len(s2))]
        solved = self.__solve(s1, 0, s2, 0)
        print(self.__memo)
        return solved

    # i1, i2 are substring starts in s1 and s2 respectively
    def __solve(self, s1: str, i1: int, s2: str, i2: int) -> int:
        if not s1 or not s2:
            return 0
        memoized = self.__get_memoized_at(i1, i2)
        if memoized != -1:
            return memoized
        if s1[0] == s2[0]:
            length = 1 + self.__solve(s1[1:], i1 + 1, s2[1:], i2 + 1)
            self.__set_memoized_at(i1, i2, length)
            return length
        length = max(self.__solve(s1, i1, s2[1:], i2 + 1), self.__solve(s1[1:], i1 + 1, s2, i2))
        self.__set_memoized_at(i1, i2, length)
        return length

    # index_of_memo in 1D representation of 2D array = len(self.__s1) * y + x
    def __get_memoized_at(self, i1: int, i2: int) -> int:
        self.__assert_position(i1, i2)
        return self.__memo[len(self.__s1) * i2 + i1]

    def __set_memoized_at(self, i1: int, i2: int, value: int):
        self.__assert_position(i1, i2)
        self.__memo[len(self.__s1) * i2 + i1] = value

    def __assert_position(self, i1: int, i2: int):
        assert i1 < len(self.__s1) and i2 < len(self.__s2)


